import styled from "styled-components";

export const ContainerFooter = styled.div`
    width:100%;
    display:flex;
    justify-content:center;
    margin-top:2rem;
    padding:1rem 0 1rem 0;
`
export const Paragrafo = styled.div`
    font-size:1.2em;
    text-transform:capitalize;
    color:#293145;
`
